import { Component } from 'react'
import logo from '../img/logo.png'

export default class Blog extends Component {
	render() {
		return (
			<main>
				<a href='/'>
					<img src={logo} alt='Главная' className='Header__logo' />
				</a>
			</main>
		)
	}
}
